svg.script:
const backgroundAnimation = (column, duration, delay) => {
	const squares = document.querySelector(`.column-${column}`).querySelectorAll('.square');
	[...squares].map((square, index) => {
		square.style.animationDelay = `${delay * (index / 5)}s`;
		square.style.animationDuration = `${duration}s`;
		square.style.animationTimingFunction = 'linear';
		square.style.animationIterationCount = 'infinite';
		square.style.animationName = 'matrix';
	});
}

